import React from 'react';
import './App.css';
import ChatBot from 'react-simple-chatbot';
import logo from './invstr-logo.png'
import { Typography, Container } from '@material-ui/core';

const steps = [
  {
    id: '0',
    message: 'Welcome to react chatbot!',
    trigger: '1',
  },
  {
    id: '1',
    message: 'Bye!',
    end: true,
  },
];


function App() {
  return (
    <Container style={{backgroundColor:"black", paddingTop:20}}>
      <img style={{width:75}} src={logo}/>
      <Typography style={{color:"white"}}>Hey There</Typography>
    </Container>
  );
}

export default App;
